import React from 'react';
import axios from 'axios';

export default class SystemList extends React.Component {
  ish;
  res =[];
  componentDidMount() {
    axios.get(`https://new.vyatsu.ru/sveden/common`)
        .then(res => {
            this.ish = res.data;
            //this.findAddresses();
        })
        
        
  }
  findAddresses() {
    const regex = /\d{6},/ //\w+ \w+, г. \w+, \w+. \w+, \w. \d{1,2,3}\d\S+/;
    let match;  
    while ((match = regex.exec(this.ish))) {
      this.res.push(match);
    }
  }
  render() {
    return (
      <div> 
        
          {/* <button onClick={this.findAddresses}> Покажи</button> */}
          {this.ish}
          {this.res}
          
      </div>
    )
  }
}
